worksheet:
- acar = 'Junajo'
- car = acar

validator:
- it("comapres not equal cars")
- expect(car).to equal('Junajos')
- it("comapres equal cars")
- expect(car).to equal('Junajo')

expect:
  tests:
  - name: comapres not equal cars
    success: false
    expected: Junajos
    actual: Junajo
  - name: comapres equal cars
    success: true
    expected: Junajo
    actual: Junajo
